var morningImage = "data:image/jpeg;base64,";
var afternoonImage = "data:image/jpeg;base64,";
var eveningImage = "data:image/jpeg;base64,";
var nightImage = "data:image/jpeg;base64,";

function findTime() {
	var time = new Date();

	if(parseInt(time.getHours()) >= 6 && parseInt(time.getHours()) < 12){
		document.write("<h1>The current time and date its:</h1>");
		document.write(time);
		createImage(morningImage);
	}
	else if(parseInt(time.getHours()) >= 12 && parseInt(time.getHours()) < 18) {
		document.write("<h1>The current time and date its:</h1>");
		document.write(time);
		createImage(afternoonImage);
	}
	else if(parseInt(time.getHours()) >=18 && parseInt(time.getHours()) < 24){
		document.write("<h1>The current time and date its:</h1>");
		document.write(time);
		createImage(eveningImage);
	}
	else if(parseInt(time.getHours()) >= 24 && parseInt(time.getHours()) < 6) {
		document.write("<h1>The current time and date its:</h1>");
		document.write(time);
		createImage(nightImage);
	}
	else {
		document.write("<h1>ERROR</h1>");
	}
}

function createImage(link) {
	var x = document.createElement("IMG");
	x.setAttribute("src", link);
	x.setAttribute("width", "304");
	x.setAttribute("height", "228");
	x.setAttribute("alt", "The Pulpit Rock");
	document.body.appendChild(x);
}